-- ----------------------------
-- Procedure structure for generate_quota_logs
-- ----------------------------
DROP PROCEDURE IF EXISTS `generate_quota_logs`;
delimiter ;;
CREATE PROCEDURE `generate_quota_logs`()
BEGIN
    DECLARE i INT DEFAULT 1;
    DECLARE tenant_id BIGINT;
    DECLARE quota_id BIGINT;
    DECLARE old_val INT;
    DECLARE new_val INT;
    
    -- 游标遍历租户配额
    DECLARE done INT DEFAULT FALSE;
    DECLARE cur CURSOR FOR 
        SELECT s_tenant_id, s_quota_id, total 
        FROM tenant_quota 
        WHERE s_tenant_id BETWEEN 1001 AND 1012;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    OPEN cur;
    read_loop: LOOP
        FETCH cur INTO tenant_id, quota_id, new_val;
        IF done THEN LEAVE read_loop; END IF;
        
        -- 每租户配额生成2-4条变更记录
        WHILE i <= 3 DO
            SET old_val = new_val + (FLOOR(RAND() * 40) - 20);
            VALUES (30000 + tenant_id*100 + quota_id*10 + i,
                   quota_id, tenant_id,
                   GREATEST(1, old_val), new_val,
                   CASE FLOOR(RAND()*4) 
                       WHEN 0 THEN '业务发展需要'
                       WHEN 1 THEN '成本控制调整'
                       WHEN 2 THEN '系统优化调整'
                       ELSE '临时活动需求'
                   END,
                   1000 + FLOOR(RAND()*20),
                   DATE_SUB(NOW(), INTERVAL FLOOR(RAND()*60) DAY),
                   1000 + FLOOR(RAND()*5),
                   CASE WHEN RAND() > 0.15 THEN 'approved' 
                        WHEN RAND() > 0.3 THEN 'rejected' 
                        ELSE 'pending' END,
                   1, CONCAT('批量生成的变更记录 #', i), 0);
            SET i = i + 1;
        END WHILE;
        SET i = 1;
    END LOOP;
    CLOSE cur;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for insert_fake_users
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_fake_users`;
delimiter ;;
CREATE PROCEDURE `insert_fake_users`()
BEGIN
  DECLARE i INT DEFAULT 1;
  WHILE i <= 100000 DO
      username,
      password,
      email,
      phone,
      status,
      create_time,
      update_time,
      create_by,
      update_by,
      is_deleted,
      delete_time
    )
    VALUES (
      CONCAT('user_', i),
      MD5('123456'),  -- 所有密码都为123456的MD5
      CONCAT('user_', i, '@example.com'),
      CONCAT('139', LPAD(FLOOR(RAND() * 100000000), 8, '0')),
      IF(MOD(i, 2) = 0, 1, 0),
      NOW(),
      NOW(),
      1,
      1,
      0,
      NULL
    );
    SET i = i + 1;
  END WHILE;
END
;;
delimiter ;

